Adivina, adivinador.

Según la página del @cnegobec, hay 1,563 candidatos a asambleístas provinciales en las elecciones para la @AsambleaEcuador 2025. 

Pero... solo uno tiene 429 procesos judiciales más que #Fito, según la página del @CJudicaturaEc 

Solo uno acumula 31 archivos de investigaciones previas por presuntos delitos como tráfico de influencias, peculado (en varias ocasiones), incumplimiento de decisiones legítimas de autoridad competente, tráfico de tierras, delitos contra el medioambiente, delitos contra la libertad de trabajo, estafa, entre otros.

Solo uno está actualmente denunciado en la @FiscaliaEcuador por peculado, asociación ilícita y otros presuntos delitos.

Solo uno está utilizando su candidatura en las elecciones para la Asamblea para evitar un juicio en el proceso No. 24100202300001, relacionado con tráfico de influencias en la compra de pruebas COVID-19 durante la pandemia (#Bukaram???), con cargos formulados en julio de 2023.

Solo uno tiene dos casos en la @CorteConstEcu, uno de ellos aún más contundente que el de #Muentes en #Durán.

Solo uno logró convertir los esteros de su cantón en pozos sépticos, hacer mágicamente desaparecer más de $112 millones de dólares en apenas uno de sus dos períodos como alcalde y no cumplir con el 90% de las obras públicas desesperadamente necesarias para su cantón.

Solo uno vendió hectáreas de tierras de su cantón que estaban denominadas de uso público a un grupo empresarial de empresas de papel con matriz en Panamá, y otorgó $10 millones de dólares en notas de crédito al mismo infame grupo empresarial como alcalde.

Solo uno tiene glosas desvanecidas por cifras millonarias, sobre las cuales la @ContraloriaECU guarda un silencio sepulcral.

Solo uno, creo, está GLOSADO. (Van a ejecutar la glosa de $8 milliones @XMauricioTorres o no?)

Y, pese a todo esto, solo uno logró, gracias a un milagroso blindaje proporcionado por su patrón, llegar al cargo de vicepresidente de la Asamblea.

¿Quién será?

